var mySwiper = new Swiper('.swiper-container', {
  autoplay: {
    delay: 5000,
  },
});

var swiper = new Swiper('.swiper-container', {
  //...
  renderCustom: function (swiper, current, total) {
    return current + ' of ' + total;
  }
});

var mySwiper = new Swiper('.swiper-container', {
  scrollbar: {
    el: '.swiper-scrollbar',
    draggable: true,
  },
});

var swiper = new Swiper('.swiper-container', {
  init: false,
  // other parameters
});
swiper.on('init', function() {
 // do something
});
// init Swiper
swiper.init();

// Otherwise use it as the parameter:
var swiper = new Swiper('.swiper-container', {
  // other parameters
  on: {
    init: function () {
      // do something
    },
  }
});
